create table employee (
	emp_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	username VARCHAR(50),
	password VARCHAR(50),
	department VARCHAR(50),
	salary VARCHAR(50),
	gender VARCHAR(50),
	mobile_no VARCHAR(50),
	email VARCHAR(50),
	pin VARCHAR(50),
	house number VARCHAR(50),
	locality VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	dob DATE,
	doj DATE
);
